#include <gtest/gtest.h>
#include "../matrix_lib/matrix_lib.h"

TEST(TestSub, basic) {
    matrix_lib::Matrix left;
    matrix_lib::Matrix right;
    matrix_lib::Matrix result;

    left = matrix_lib::Matrix{{-36, -14},
                              {-9,  -34}};
    right = matrix_lib::Matrix{{48,  -32},
                               {-28, -27}};
    result = matrix_lib::Matrix{{-84, 18},
                                {19,  -7}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-39, 35},
                              {-31, -24}};
    right = matrix_lib::Matrix{{49, 2},
                               {4,  -13}};
    result = matrix_lib::Matrix{{-88, 33},
                                {-35, -11}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{35,  -33},
                              {-29, -17}};
    right = matrix_lib::Matrix{{-20, -39},
                               {-24, 5}};
    result = matrix_lib::Matrix{{55, 6},
                                {-5, -22}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-46, 38},
                              {-3,  10}};
    right = matrix_lib::Matrix{{40, 38},
                               {3,  -1}};
    result = matrix_lib::Matrix{{-86, 0},
                                {-6,  11}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-25, 29},
                              {42,  8}};
    right = matrix_lib::Matrix{{34, -24},
                               {44, -46}};
    result = matrix_lib::Matrix{{-59, 53},
                                {-2,  54}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-36, -46},
                              {-13, 10}};
    right = matrix_lib::Matrix{{-23, -45},
                               {-34, 21}};
    result = matrix_lib::Matrix{{-13, -1},
                                {21,  -11}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-15, -27},
                              {-13, 40}};
    right = matrix_lib::Matrix{{49,  13},
                               {-32, -24}};
    result = matrix_lib::Matrix{{-64, -40},
                                {19,  64}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-18, 30},
                              {39,  5}};
    right = matrix_lib::Matrix{{-46, -30},
                               {-27, 20}};
    result = matrix_lib::Matrix{{28, 60},
                                {66, -15}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{45, 7},
                              {31, -5}};
    right = matrix_lib::Matrix{{-20, -31},
                               {39,  -18}};
    result = matrix_lib::Matrix{{65, 38},
                                {-8, 13}};
    EXPECT_EQ(left - right, result);

    left = matrix_lib::Matrix{{-24, -33},
                              {45,  6}};
    right = matrix_lib::Matrix{{15,  8},
                               {-50, 49}};
    result = matrix_lib::Matrix{{-39, -41},
                                {95,  -43}};
    EXPECT_EQ(left - right, result);
}

